import {Table} from 'react-bootstrap';
;

export default function CarrinhoComponente(props) {
    return (
        <Table key={props.id}>
            <thead>
                <tr>
                    <th>Produto</th>
                    <th>Descrição</th>
                    <th>Preço</th>
                    <th>Quantidade</th>
                </tr>
            </thead>
        </Table>
    )
}
